import string


def repl_nums(c):
    if c in '01':
        return c
    return f"$(($((1<<1))#{bin(int(c))[2:]}))"


def t(c):
    # if c not in "01#$'()<\\":
    return '\\\\'+''.join([repl_nums(_) for _ in oct(ord(c))[2:].zfill(3)])
